import React from 'react';
import { Static } from './Static';
import { testProperties } from './Static';
import './App.css';

function App() {
  return (
    <div className="App">
      <div 
        className="header"
        style={{
          display: 'flex',
          alignItems: 'center',
          gap: '10px',
          fontSize: '20px',
          fontWeight: '600',
          color: '#333',
          margin: '0',
          fontFamily: 'Poppins, sans-serif',
          lineHeight: '1.4',
          paddingTop: '20px',
          paddingBottom: '10px',
          paddingLeft: '15px',
          backgroundColor: 'white',
          marginBottom: '20px'
        }}
      >
        <img src="/logo.svg" alt="Логотип" className="logo" style={{ width: '55px', height: '40px' }} />
        <span>Подобранная недвижимость</span>
      </div>

      <Static properties={testProperties} />
    </div>
  );
}

export default App;
